CONTRATAÇÃO POR DISPENSA DE LICITAÇÃO DE PESSOA JURÍDICA ESPECIALIZADA PARA ELABORAÇÃO DE PROJETOS DE ENGENHARIA A FIM DE SUBSIDIAR O PROCESSO LICITATÓRIO PARA REVITALIZAÇÃO DOS TANQUES AÉREOS (200 M³ E 42M³) DE ÓLEO DIESEL MARÍTIMO E DA REDE DE ABASTECIMENTO (DUTOS, BOMBAS E BACIAS DE CONTENÇÃO), CONTEMPLANDO OS ASPECTOS DE ESTRUTURA CIVIL, AMBIENTAL, COMBATE A INCÊNDIO E ELÉTRICA DO CENTRO DE INTENDÊNCIA DA MARINHA EM NATAL.
- REALIZAÇÃO DE TODOS OS TESTES NECESSÁRIOS PARA ELABORAÇÃO DOS ESTUDOS COMO, POR EXEMPLO, TESTE DE ESTANQUEIDADE E ESPESSURA DE CHAPA;
-ELABORAÇÃO DOS DOCUMENTOS DE PLANEJAMENTO (PROGRAMA DE NECESSIDADES, TERMO DE JUSTIFICATIVAS TÉCNICAS RELEVANTES, MEMORIAL DESCRITIVO, PLANILHA ESTIMATIVA DE CUSTOS E FORMAÇÃO DE PREÇOS, CRONOGRAMA FÍSICO-FINANCEIRO, PLANILHA ESTIMATIVA DE COMPOSIÇÃO DE BDI E PROJETO EXECUTIVO);
- ELABORAÇÃO DOS PROJETOS DE ESTRUTURAS, FUNDAÇÕES, COMBATE A INCÊNDIO E PROTEÇÃO AMBIENTAL;
- ELABORAÇÃO DO PROJETO DE INSTALAÇÕES ELÉTRICAS EM BAIXA TENSÃO;
- ELABORAÇÃO DOS PROJETOS DE SISTEMAS DE ARMAZENAMENTO, DISTRIBUIÇÃO E ABASTECIMENTO DE COMBUSTÍVEIS LÍQUIDOS;
- APRESENTAÇÃO DE ART; E
-ACOMPANHAMENTO DO PROCESSO LICITATÓRIO PARA REVITALIZAÇÃO DOS TANQUES A FIM DE RESPONDER POSSÍVEIS ESCLARECIMENTOS TÉCNICOS E REALIZAR AJUSTES EVENTUALMENTE NECESSÁRIOS.
